// para navegar no header
import { Link } from 'react-router-dom' ;

function Header(){
    return(
       
        <div className='menu_header'>
            <Link to="/">Home</Link>
            <Link to="/sobre">Sobre</Link>
            <Link to="/">Contato</Link>
            <Link to="/">Projetos</Link>            
        </div>
        
              
           
        
    )
}

export default Header;
